import React, { useContext } from 'react'
import { Context } from '../../context'

export default function Back() {
  const { isDarkMode } = useContext(Context)
  const fillColor = !isDarkMode ? 'black' : 'white'

  return (
    <svg width="44" height="43" viewBox="0 0 44 43" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M36.6668 19.7082H14.3552L24.6035 9.69275L22.0002 7.1665L7.3335 21.4998L22.0002 35.8332L24.5852 33.3069L14.3552 23.2915H36.6668V19.7082Z" fill={fillColor} fillOpacity="0.87"/>
    </svg>
  )
}
